import React from 'react';
import fotoPerfil from '../img/fotoAndre.JPG';
import logoLinkedin from '../img/logoLinkedin.png';
import logoGitHub from '../img/logoGitHub.png';

class Home extends React.Component {
  render() {
    return (
      <div class="homeallHightScreen">
        <label htmlFor="fotoPerfil">
          <img src={fotoPerfil} alt="fotoPerfil" class="fotoPerfil" width="100" id="fotoPerfil"/>
          <h1>Andr√© Barroso</h1>
        </label>
        <img src={logoLinkedin} alt="logoLinkedin" class="fotoRedesSociais" width="50"/>
        <img src={logoGitHub} alt="logoGitHub" class="fotoRedesSociais" width="50"/>
        <button type="button" class="btn btn-danger">Contacte-me</button>
      </div>
    )
  }
}
export default Home;
